import { z } from 'zod';

import { json } from 'lib/utils';

export const input = z.object({
  text: z
    .string()
    .min(1, 'Text is required')
    .describe(json({ label: 'Text', kind: 'string' })),

  font: z
    .object({
      fontSize: z.string(),
      fontFamily: z.string(),
      textAlign: z.enum(['left', 'center', 'right', 'justify'])
    })
    .describe(
      json({
        label: 'Font',
        kind: 'font',
        default: {
          fontSize: '20px',
          fontFamily: 'Jua',
          textAlign: 'center'
        }
      })
    ),
  container: z
    .object({
      padding: z.string(),
      margin: z.string()
    })
    .describe(
      json({
        label: 'Box',
        kind: 'container',
        default: {
          padding: '20px',
          margin: '0px'
        }
      })
    )
});

export default function Ghibli({
  text = 'Normal text',
  font = {
    fontSize: '20px',
    fontFamily: 'Jua',
    textAlign: 'center'
  },
  container = {
    padding: '20px',
    margin: '0px'
  }
}: Partial<z.infer<typeof input>>) {
  return (
    <div
      className="flex-1"
      style={{
        fontSize: font.fontSize,
        fontFamily: font.fontFamily,
        textAlign: font.textAlign,

        padding: container.padding,
        margin: container.margin
      }}
    >
      {text}

      <style jsx>{`
        @import url('https://fonts.googleapis.com/css2?${[font.fontFamily]
          .map(font => `family=${font.replaceAll(' ', '+')}&display=swap`)
          .join('&')}&display=swap');

        div {
          font-weight: 900;
          color: #4e3a1a;
          letter-spacing: 2px;

          text-shadow:
            1px 1px 0px #ffedc157,
            -1px 0px 0px #ffedc157,
            -1px -1px 0px #ffedc157,
            1px -1px 0px #ffedc157;

          border-image-slice: 60 60 60 65 fill;
          border-image-width: 20px 20px 20px 20px;
          border-image-outset: 0px 0px 0px 0px;
          border-image-repeat: stretch stretch;
          border-style: solid;
          border-image-source: url('data:image/png;base64,');
        }
      `}</style>
    </div>
  );
}

export function Editor() {
  return null;
}
